<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1" />
  <title>Audio Player Overlay Transparent Background</title>
  <style>
    body {
      margin: 0;
      font-family: Arial, sans-serif;
      display: flex;
      justify-content: center;
      align-items: center;
      height: 100vh;
      background: #222;
    }
    .container {
      position: relative;
      width: 320px;
      max-width: 90vw;
      border-radius: 12px;
      overflow: hidden;
      box-shadow: 0 8px 20px rgba(0, 0, 0, 0.6);
    }
    .container img {
      display: block;
      width: 100%;
      height: auto;
      user-select: none;
      pointer-events: none;
    }
    .player-container {
      position: absolute;
      bottom: 20px;
      left: 50%;
      transform: translateX(-50%);
      /* Transparent background */
      background: transparent;
      border-radius: 8px;
      padding: 10px;
      color: white;
      width: 90%;
      box-sizing: border-box;
      user-select: none;
      text-align: center;
      /* Text shadow for readability */
      text-shadow: 0 0 5px rgba(0,0,0,0.8);
    }
    .track-title {
      font-weight: bold;
      margin-bottom: 8px;
      font-size: 1.1rem;
      /* Stronger text shadow for better contrast */
      text-shadow: 0 0 8px rgba(0, 0, 0, 0.9);
    }
    audio {
      width: 100%;
      outline: none;
      -webkit-appearance: none;
      background: transparent;
      filter: drop-shadow(0 0 2px rgba(0,0,0,0.7));
    }
    .controls {
      display: flex;
      justify-content: space-between;
      margin-top: 10px;
    }
    button {
      background: rgba(255 255 255 / 0.15);
      color: white;
      border: none;
      padding: 6px 14px;
      border-radius: 5px;
      cursor: pointer;
      transition: background 0.3s ease;
      font-size: 1rem;
      user-select: none;
      text-shadow: 0 0 5px rgba(0,0,0,0.7);
    }
    button:hover,
    button:focus {
      background: rgba(255 255 255 / 0.35);
      outline: none;
    }
    @media (max-width: 400px) {
      .container {
        width: 280px;
      }
      .player-container {
        bottom: 15px;
        padding: 8px;
      }
      button {
        padding: 5px 12px;
        font-size: 0.9rem;
      }
    }
  </style>
</head>

      <div class="track-title" id="trackTitle">Beanie</div>
      <audio id="audioPlayer" controls autoplay muted loop>
        <source src="Beanie Ringtone Download - MobCup.Com.Co.mp3" type="audio/mpeg" />
        Your browser does not support the audio element.
      </audio>
      <div class="controls">
        <button id="prevBtn" aria-label="Previous track" type="button">Prev</button>
        <button id="nextBtn" aria-label="Next track" type="button">Next</button>
      </div>
    </div>
  </div>

  <script>
    (function() {
      const tracks = [
        {
          title: 'Beanie',
          src: 'Beanie Ringtone Download - MobCup.Com.Co.mp3',
          type: 'audio/mpeg',
          autoplay: true,
          muted: true,
          loop: true,
        },
        {
          title: 'Evergreen',
          src: 'Evergreen [vA4ewUgA_SM].mp3',
          type: 'audio/mpeg',
          autoplay: false,
          muted: false,
          loop: false,
        },
        {
          title: 'Snowfall',
          src: 'øneheart x reidenshi - snowfall [LlN8MPS7KQs].mp3',
          type: 'audio/mpeg',
          autoplay: false,
          muted: false,
          loop: false,
        }
      ];

      let currentIndex = 0;
      const audioPlayer = document.getElementById('audioPlayer');
      const trackTitle = document.getElementById('trackTitle');
      const prevBtn = document.getElementById('prevBtn');
      const nextBtn = document.getElementById('nextBtn');

      function loadTrack(index) {
        const track = tracks[index];
        audioPlayer.pause();
        // Remove all existing sources first
        while(audioPlayer.firstChild) {
          audioPlayer.removeChild(audioPlayer.firstChild);
        }

        const sourceEl = document.createElement('source');
        sourceEl.src = track.src;
        sourceEl.type = track.type;
        audioPlayer.appendChild(sourceEl);

        // Set attributes accordingly
        if (track.autoplay) audioPlayer.setAttribute('autoplay', '');
        else audioPlayer.removeAttribute('autoplay');

        audioPlayer.muted = !!track.muted;

        if (track.loop) audioPlayer.setAttribute('loop', '');
        else audioPlayer.removeAttribute('loop');

        trackTitle.textContent = track.title;

        audioPlayer.load();
        audioPlayer.play().catch(() => {
          // Autoplay might be blocked by browser, that's ok
        });
      }

      prevBtn.addEventListener('click', () => {
        currentIndex = (currentIndex - 1 + tracks.length) % tracks.length;
        loadTrack(currentIndex);
      });

      nextBtn.addEventListener('click', () => {
        currentIndex = (currentIndex + 1) % tracks.length;
        loadTrack(currentIndex);
      });

      // Initialize player on page load
      loadTrack(currentIndex);
    })();
  </script>
